import React from 'react';
import { Form, Message, Button, Input } from 'semantic-ui-react';
import Data from '../db.json';
// const config = require('config');
// const Questions = config.get('Questions');

const DefaultPage = () => {
  const { Questions } = Data;
  return (
    <Form error>
      {Questions &&
        Questions.map((question) => (
          <>
            <Form.Group inline equal>
              <Form.Field>
                <label widths={7}>{question.question}</label>
                <Input placeholder="your answer" widths={3} />
              </Form.Field>
              {/* <Form.Input placeholder={question.question} width={8} disabled />
              <Form.Input placeholder={question.answer} width={2} /> */}
              <Button>Submit</Button>
              {/* <Message error header="Wrong!" content="You have 2 more try" />{' '} */}
            </Form.Group>
          </>
        ))}
    </Form>
  );
};

// IMPORT DATA FROM DB

export default DefaultPage;
